import React from 'react';
import Header from "./Header";
import Footer from "./Footer";
import Content from "./Content";

function App() {
  return (
    <div >
    <div><Header/></div>
    <div><Content/></div>
    <div><Footer/></div>
    </div>
  );
}

export default App;
